    false,nt"url": null,nt"notes": "This annual narrative report for Trempealeau
    National Wildlife Refuge summarizes Refuge activities during the 2002 fiscal year.
     The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    surveys and censuses- is provided next.  Habitat restoration and management projects
    are also covered; activities include riverine restoration, water level management,
    prescribed burning, and vegetation control.  Fish and wildlife management is discussed
    next with emphasis on bird banding.  Coordination activities, such as private land
    activities, are outlined.  The resource protection section provides information
    about law enforcement.  Information about public education and recreation is given
    including hunting, fishing, and interpretation.  Finally, Refuge planning and administration-
    including Comprehensive Conservation Planning and general administration- are discussed.
     Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
